@cburden2017 Do not lie with a male as with a woman” (Leviticus 22:18).
“If a man lies to a man as a female, then both have committed an abomination; both shall be put to death, and their blood shall be upon them” (Leviticus 20:13).
“Therefore, God also gave them, in the lusts of their hearts, uncleanness, and the dishonoring of their bodies among themselves.. who exchanged the truth of God for a lie.. And they feared and worshiped the creature rather than the Creator, who is blessed forever. Amen. Therefore God delivered them to the passions of shame, because their females exchanged natural benefit for what is contrary to nature.” ... Likewise, males also, who, having forsaken the natural use of the female, kindled in their lusts for one another, males with males committing indecency, and received in themselves the penalty of their justified error” (Romans 1:24-27). These are the words of the Lord, and I believe that everything that the Lord says has a reason, and this is my opinion, and I believe that as you express your opinion I express your opinion, this is also my right. I express my opinion, and I will teach my children to respect the word of the Lord, not the word of a slave and thanks
